<?php

# @autogenerated
declare(strict_types=1);

use Civi\Lughauth\Features\Access\Master\User\Domain\UserRef;
use Civi\Lughauth\Features\Access\Master\TenantTermsOfUse\Domain\TenantTermsOfUseRef;
use Civi\Lughauth\Features\Access\Master\UserAcceptedTermnsOfUse\Domain\ValueObject\UserAcceptedTermnsOfUseUserVO;
use Civi\Lughauth\Features\Access\Master\UserAcceptedTermnsOfUse\Domain\ValueObject\UserAcceptedTermnsOfUseConditionsVO;
use Civi\Lughauth\Features\Access\Master\UserAcceptedTermnsOfUse\Domain\ValueObject\UserAcceptedTermnsOfUseAcceptDateVO;
use Civi\Lughauth\Features\Access\Master\UserAcceptedTermnsOfUse\Domain\ValueObject\UserAcceptedTermnsOfUseVersionVO;
use Civi\Lughauth\Features\Access\Master\UserAcceptedTermnsOfUse\Domain\UserAcceptedTermnsOfUseAttributes;
use PHPUnit\Framework\TestCase;

final class UserAcceptedTermnsOfUseAttributesUnitTest extends TestCase
{
    public function test(): void
    {
        $value = new UserAcceptedTermnsOfUseAttributes();
        $userOneValue = new UserRef('one');
        $userOtherValue = new UserRef('other');
        $copy = $value->user($userOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(new UserRef('one'), $value->getUser());
        $this->assertNotEquals(new UserRef('other'), $value->getUser());
        $this->assertEquals(new UserRef('one'), $value->getUserOrDefault(UserAcceptedTermnsOfUseUserVO::from($userOtherValue))->value());
        $this->assertNotEquals(new UserRef('other'), $value->getUserOrDefault(UserAcceptedTermnsOfUseUserVO::from($userOtherValue))->value());
        $value->unsetUser();
        $this->assertEquals(new UserRef('other'), $value->getUserOrDefault(UserAcceptedTermnsOfUseUserVO::from($userOtherValue))->value());
        $this->assertNotEquals(new UserRef('one'), $value->getUserOrDefault(UserAcceptedTermnsOfUseUserVO::from($userOtherValue))->value());
        $conditionsOneValue = new TenantTermsOfUseRef('one');
        $conditionsOtherValue = new TenantTermsOfUseRef('other');
        $copy = $value->conditions($conditionsOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(new TenantTermsOfUseRef('one'), $value->getConditions());
        $this->assertNotEquals(new TenantTermsOfUseRef('other'), $value->getConditions());
        $this->assertEquals(new TenantTermsOfUseRef('one'), $value->getConditionsOrDefault(UserAcceptedTermnsOfUseConditionsVO::from($conditionsOtherValue))->value());
        $this->assertNotEquals(new TenantTermsOfUseRef('other'), $value->getConditionsOrDefault(UserAcceptedTermnsOfUseConditionsVO::from($conditionsOtherValue))->value());
        $value->unsetConditions();
        $this->assertEquals(new TenantTermsOfUseRef('other'), $value->getConditionsOrDefault(UserAcceptedTermnsOfUseConditionsVO::from($conditionsOtherValue))->value());
        $this->assertNotEquals(new TenantTermsOfUseRef('one'), $value->getConditionsOrDefault(UserAcceptedTermnsOfUseConditionsVO::from($conditionsOtherValue))->value());
        $acceptDateOneValue = (new \DateTimeImmutable('1980-08-20T14:32:45.123Z'));
        $acceptDateOtherValue = (new \DateTimeImmutable('1981-09-06T14:32:45.123Z'));
        $copy = $value->acceptDate($acceptDateOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals((new \DateTimeImmutable('1980-08-20T14:32:45.123Z')), $value->getAcceptDate());
        $this->assertNotEquals((new \DateTimeImmutable('1981-09-06T14:32:45.123Z')), $value->getAcceptDate());
        $this->assertEquals((new \DateTimeImmutable('1980-08-20T14:32:45.123Z')), $value->getAcceptDateOrDefault(UserAcceptedTermnsOfUseAcceptDateVO::from($acceptDateOtherValue))->value());
        $this->assertNotEquals((new \DateTimeImmutable('1981-09-06T14:32:45.123Z')), $value->getAcceptDateOrDefault(UserAcceptedTermnsOfUseAcceptDateVO::from($acceptDateOtherValue))->value());
        $value->unsetAcceptDate();
        $this->assertEquals((new \DateTimeImmutable('1981-09-06T14:32:45.123Z')), $value->getAcceptDateOrDefault(UserAcceptedTermnsOfUseAcceptDateVO::from($acceptDateOtherValue))->value());
        $this->assertNotEquals((new \DateTimeImmutable('1980-08-20T14:32:45.123Z')), $value->getAcceptDateOrDefault(UserAcceptedTermnsOfUseAcceptDateVO::from($acceptDateOtherValue))->value());
        $versionOneValue = 1;
        $versionOtherValue = 2;
        $copy = $value->version($versionOneValue);
        $this->assertSame($value, $copy);
        $this->assertEquals(1, $value->getVersion());
        $this->assertNotEquals(2, $value->getVersion());
        $this->assertEquals(1, $value->getVersionOrDefault(UserAcceptedTermnsOfUseVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(2, $value->getVersionOrDefault(UserAcceptedTermnsOfUseVersionVO::from($versionOtherValue))->value());
        $value->unsetVersion();
        $this->assertEquals(2, $value->getVersionOrDefault(UserAcceptedTermnsOfUseVersionVO::from($versionOtherValue))->value());
        $this->assertNotEquals(1, $value->getVersionOrDefault(UserAcceptedTermnsOfUseVersionVO::from($versionOtherValue))->value());
        $this->assertSame($value, $copy);
    }
}
